【取付説明書付き！保証1年付き！】<br>
この装置を車に装着することでドアロックでミラー格納・エンジンをかけるとミラーが展開します。当製品1つで左右のミラー制御が可能となります。<br><br>
【商品詳細】<br>
●純正のドアミラー格納スイッチは従来通り、走行中でも使用可能です。<br>
●スマートキーシステム、プッシュスタート、イモビ装着車、セキュリティ装着車両などにも問題なく取り付け可能です。<br><br>
【セット内容】<br>本体×1、本体用コネクタケーブル×1、取付説明書<br><br>
【特記事項】<br>
●商品名にある車種・型式に対応しております。<br>
●取り付けは個人差がありますが「詳細な説明書があったのでとても簡単に取り付けできました」と御好評いただいております。<br><br>
※ボタンを押した場合の戻し方<br>キーレスロック（ミラー閉じてます）→キーレスアンロック（ミラー開きます）→エンジンON（ミラー閉じます）→ボタンで開く→エンジンOFF→キーレスロック（ミラー閉じません）→キーレスアンロック（ミラー閉じます）→そのままエンジンON（ミラー開きます）→これで正常動作に戻りました。<br>







<style type="text/css">

/***買い物かごまわり全ボタン・入力欄共通***/
input#normal_basket_10009841,input#normal_basket_10014922,input#normal_basket_10023802,normal_basket_10026828,normal_basket_10026855,normal_basket_10026661,normal_basket_10023647,normal_basket_10026632 {
width: 252px;
height: 52px;
white-space: nowrap;
text-indent: 110%;
overflow: hidden;
background:url(http://www.rakuten.ne.jp/gold/auc-cb-if/img/cartbutton.jpg) no-repeat;
border:none;
}

/***「個数」部分***/
input#units{
border:solid #ccc 1px;
background:#fff;
width:30px;
height:20px;
line-height:20px;
text-align:center;
}

/***「お問合せ」ボタン***/
font input{
border:solid #ccc 1px;
background:#eeeeee;
background-image:none;
}

/***「項目選択肢部分」***/
.inventory input{
background:#fff;
}

</style>


